    LocationCreateComponent.prototype.changeLocType = function () {
        var pattern = /^[^-\s][a-zA-Z0-9_\s-]+$/;
        this.locTypeError.isValid = false;
        if (!this.newLocType) {
            this.locTypeError.isEmpty = true;
        }
        else {
            if (this.newLocType.trim().length > 0) {
                this.locTypeError.isEmpty = false;
            }
            else {
                this.locTypeError.isEmpty = true;
            }
            if (this.newLocType.length > 100) {
                this.locTypeError.maxLength = true;
            }
            else {
                this.locTypeError.maxLength = false;
                if (!this.locTypeError.isEmpty) {
                    if (pattern.test(this.newLocType)) {
                        this.locTypeError.isValid = true;
                    }
                    else {
                        this.locTypeError.isValid = false;
                    }
                }
            }
        }
    };
